import classes from './Card.module.css'
import { Link } from 'react-router-dom';


const Card = (props) => {


    return (
        <div className={classes.card}>
            <Link to={`/auth`}><h3>{props.title}</h3></Link>
            <Link to={`/${props.id}`}>
                <p>{props.location}</p>
                <p>{props.type}</p>
                <p>{props.description}</p>
            </Link>
        </div>
    )

}


export default Card
